"use strict";

const f_gold = (richer, quiet) => {
    const n = quiet.length;
    const g = new Map();
    for (const [a, b] of richer) {
        if (!g.has(b)) {
            g.set(b, []);
        }
        g.get(b).push(a);
    }
    const ans = Array(n).fill(-1);
    const dfs = (i) => {
        if (ans[i] !== -1) {
            return;
        }
        ans[i] = i;
        for (const j of g.get(i) || []) {
            dfs(j);
            if (quiet[ans[j]] < quiet[ans[i]]) {
                ans[i] = ans[j];
            }
        }
    };
    for (let i = 0; i < n; i++) {
        dfs(i);
    }
    return ans;
};
